USE IQVIA_IC
GO

IF OBJECT_ID('TEMPDB..#PRODUTO_PRECO') IS NOT NULL DROP TABLE #PRODUTO_PRECO

CREATE TABLE #PRODUTO_PRECO
(
	PERIODO			DATETIME NOT NULL,
	CODIGO_PRODUTO	VARCHAR(14) NOT NULL,
	PRECO			FLOAT NOT NULL
)


SELECT A.PERIODO, B.ID_PRODUTO, A.PRECO
  FROM #PRODUTO_PRECO A
  JOIN PRODUTO B
    ON A.CODIGO_PRODUTO = B.CODIGO

IF OBJECT_ID('TEMPDB..#PRODUTO_PRECO') IS NOT NULL DROP TABLE #PRODUTO_PRECO